import React from 'react';
import { Section } from './Header.styled';
import { RiMenuAddLine } from 'react-icons/ri';
import { MenuBtn, Logo } from './Header.styled';
import {MenuBurgerImg} from '../../icons/IconComponent.jsx'

export const Header = () => {
  return (
    <Section>
      <MenuBtn
        type="button"
        aria-label="burger-menu"
        title="Menu"
        onClick={() => {
          console.log("Menu open")
        }}
      >
        {/* <RiMenuAddLine style={{ fill: 'white', width: '24', height: '24' }} /> */}
        <MenuBurgerImg/>
      </MenuBtn>
      
      <Logo>HeaderLogo</Logo>
    </Section>
  );
};
